import {
	Paper,
	Table,
	TableBody,
	TableCell,
	TableContainer,
	TableHead,
	TableRow,
	Button,
	makeStyles,
  } from '@mui/material';
  import React, { useEffect, useState } from 'react';
  
  const useStyles = makeStyles((theme) => ({
	table: {
	  minWidth: 650,
	},
	orderContainer: {
	  marginTop: theme.spacing(2),
	  padding: theme.spacing(2),
	  backgroundColor: theme.palette.background.paper,
	},
	orderItem: {
	  display: 'flex',
	  justifyContent: 'space-between',
	  alignItems: 'center',
	  marginBottom: theme.spacing(1),
	},
  }));
  
  const ProductTable = ({ cellsData, cellsName }) => {
	const classes = useStyles();
	const [itemData, setItemData] = useState([]);
	const [order, setOrder] = useState([]);
  
	useEffect(() => {
	  const fetchData = async () => {
		const url = 'http://localhost:8080/api/pizza/product';
  
		try {
		  const response = await fetch(url);
		  if (!response.ok) {
			throw new Error('Failed to fetch items data');
		  }
		  const data = await response.json();
		  setItemData(data);
		} catch (error) {
		  console.error(error);
		}
	  };
  
	  fetchData();
	}, []);
  
	const addToOrder = (item) => {
	  setOrder([...order, item]);
	};
  
	const removeFromOrder = (item) => {
	  setOrder(order.filter((i) => i.id !== item.id));
	};
  
	return (
	  <div>
		<TableContainer component={Paper}>
		  <Table className={classes.table} aria-label="simple table">
			<TableHead>
			  <TableRow>
				{cellsName.map((name, index) => (
				  <TableCell key={name} align="center">
					{name}
				  </TableCell>
				))}
				<TableCell align="center">Action</TableCell>
			  </TableRow>
			</TableHead>
			<TableBody>
			  {itemData.map((item) => (
				<TableRow key={item.id}>
				  <TableCell align="center">{item.id}</TableCell>
				  <TableCell align="center">{item.name}</TableCell>
				  <TableCell align="center">{item.price}</TableCell>
				  <TableCell align="center">{item.description}</TableCell>
				  <TableCell align="center">{item.imageId}</TableCell>
				  <TableCell align="center">{item.categoryName}</TableCell>
				  <TableCell align="center">
					<Button
					  variant="contained"
					  color="primary"
					  onClick={() => addToOrder(item)}
					>
					  Add to Order
					</Button>
				  </TableCell>
				</TableRow>
			  ))}
			</TableBody>
		  </Table>
		</TableContainer>
  
		<div className={classes.orderContainer}>
		  <h2>Your Order:</h2>
		  {order.length === 0 ? (
			<p>Your order is empty.</p>
		  ) : (
			<div>
			  {order.map((item, index) => (
				<div key={index} className={classes.orderItem}>
				  <span>
					{item.name} - ${item.price}
				  </span>
				  <Button
					variant="contained"
					color="secondary"
					onClick={() => removeFromOrder(item)}
				  >
					Remove
				  </Button>
				</div>
			  ))}
			</div>
		  )}
		</div>
	  </div>
	);
  };
  
  export default ProductTable;
